import React, { useState } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import Alert from '@mui/material/Alert';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';

import Box from '@mui/material/Box';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import AccountCircle from '@mui/icons-material/AccountCircle';

let Main =()=>{
 
const [count,setCount] = useState(1);


    /*Get Year */
    const year = new Date().getFullYear();
    
    
    
    return(
        <>
            

    <Container>
      <Row>
        <Col>
        
        <h1 className='text-center'>Lets Play!!</h1>

        <Box sx={{ '& > :not(style)': { m: 1 } }}>
      <FormControl variant="standard">
        <InputLabel htmlFor="input-with-icon-adornment">
          With a start adornment
        </InputLabel>
        <Input
          id="input-with-icon-adornment"
          startAdornment={
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          }
        />
      </FormControl>
      <TextField
        id="input-with-icon-textfield"
        label="TextField"
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
        variant="standard"
      />
      <Box sx={{ display: 'flex', alignItems: 'flex-end' }}>
        <AccountCircle sx={{ color: 'action.active', mr: 1, my: 0.5 }} />
        <TextField id="input-with-sx" label="With sx" variant="standard" />
      </Box>
    </Box>

        <Card style={{ width: '23rem'}}>
        
      <Card.Body style={{"height":"150px","backgroundColor":"#000","borderRadius":"15px"}}>
        <Card.Title style={{"fontSize":"100px","textAlign":"center",color:"#7CFC00"}}>{count}</Card.Title>
      </Card.Body>
   
        <ListGroup.Item>
        <Alert
        action={
          <Button color="inherit" size="small">
            UNDO
          </Button>
        }
      >
        This is a success alert â€” check it out!
      </Alert>
        </ListGroup.Item>
       
      
      <Card.Body>
        <Card.Link href="#" style={{"textDecoration":"none","textAlign":"center"}}>&#169; {year} aakashkasturiya</Card.Link>
      
      </Card.Body>
    </Card>


        
        </Col>
      </Row>
    </Container>


        
        </>
    );
}

export default Main;
